export class TableTop {
    constructor(robot) {
        if (robot.location) {
            this.grid = this.grid = [
                ["null", "null", "null", "null", "null"],
                ["null", "null", "null", "null", "null"],
                ["null", "null", "null", "null", "null"],
                ["null", "null", "null", "null", "null"],
                ["null", "null", "null", "null", "null"]
            ]
        } else {
            this.grid = [
                [null, null, null, null, null],
                [null, null, null, null, null],
                [null, null, null, null, null],
                [null, null, null, null, null],
                [null, null, null, null, null]
            ]
        }

    }
}

export class Robot {
    constructor() {
        this.location = null
    }

    place() {
        this.location = [2, 2]
    }
}
